      SYKES, Peter Brian and BIDMEAD, Vicki Ann (cont...)
      primary school teacher, then as a youth worker. After ordination as a Deacon in the Anglican
      Church in 1985 and served at Ponsonby, Howick, and Mangere East Parish. He is a community
      development worker, particularly with youth, education, health and housing issues. Currently he is
      employed as Director, Mangere East Family Service Centre.
      Peter is a trustee of the Henry and William Williams Memorial Trust, 'Archdeacon' for the Anglican
      Deacons of New Zealand, and Chaplain and Junior Committee Chairperson of the Mangere East Rugby
      League Football Club.
      Vicki was educated at Bayfield Primary School, Auckland Girls' Grammar School and Auckland
      University. She trained and worked as an intermediate school teacher. After study at St John's
      Theological College, Auckland, she was ordained Priest in 1987. Vicki served at Ponsonby, Howick
      and Mangere East Parish. Currently she is Director of Friendship House, an ecumenical agency
      providing hospitality and social services in Manukau City Centre. She has been involved in many
      Church groups, and currently convenes the Diocesan Sexual Harassment Monitoring Group.
